package vo;

public class CartVo {
	
	int    c_idx;
	int    m_idx;
	int    b_idx;
	int    u_idx;
	String b_name;
	String b_isbn;
	int    b_price;
	int    b_saleprice;
	int    c_cnt;
	int    amount;
	
	public CartVo() {
		// TODO Auto-generated constructor stub
	}

	public int getC_idx() {
		return c_idx;
	}

	public void setC_idx(int c_idx) {
		this.c_idx = c_idx;
	}

	public int getM_idx() {
		return m_idx;
	}

	public void setM_idx(int m_idx) {
		this.m_idx = m_idx;
	}

	public int getB_idx() {
		return b_idx;
	}

	public void setB_idx(int b_idx) {
		this.b_idx = b_idx;
	}

	public int getU_idx() {
		return u_idx;
	}

	public void setU_idx(int u_idx) {
		this.u_idx = u_idx;
	}

	public String getB_name() {
		return b_name;
	}

	public void setB_name(String b_name) {
		this.b_name = b_name;
	}

	public String getB_isbn() {
		return b_isbn;
	}

	public void setB_isbn(String b_isbn) {
		this.b_isbn = b_isbn;
	}

	public int getB_price() {
		return b_price;
	}

	public void setB_price(int b_price) {
		this.b_price = b_price;
	}

	public int getB_saleprice() {
		return b_saleprice;
	}

	public void setB_saleprice(int b_saleprice) {
		this.b_saleprice = b_saleprice;
	}

	public int getC_cnt() {
		return c_cnt;
	}

	public void setC_cnt(int c_cnt) {
		this.c_cnt = c_cnt;
	}

	public int getAmount() {
		return amount;
	}

	public void setAmount(int amount) {
		this.amount = amount;
	}
	
	
	
	
}
